  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Age-adjusted death rates (deaths per
  100,000) are based on the 2000 U.S. standard population. Populations used for computing
  death rates for 2011u00e2u0080u00932013 are postcensal estimates based on the 2010
  census, estimated as of July 1, 2010. Rates for census years are based on populations
  enumerated in the corresponding censuses. Rates for noncensus years before 2010
  are revised using updated intercensal population estimates and may differ from rates
  previously published.</p>n<p><a href=\"http://blogs.cdc.gov/nchs-data-visualization/deaths-in-the-us/\">http://blogs.cdc.gov/nchs-data-visualization/deaths-in-the-us/</a></p>n\",\n\t\"license_title\":
